import React, {useState} from 'react';

class SignUp extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: "user",
            form: this.welcome()
        };
    }

    welcome=()=>{
        return(
            <div>
                <h1>{this.state.name}</h1>
            </div>
        )
    }

    render(){
        return(
            <div>
                {this.state.form}
            </div>
        )
    }
}

export default SignUp;
